INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(302, 0, , 'NASA Awards Mars Ascent Propulsion System Contract for Sample Return', 2, 'NASA has awarded the Mars Ascent Propulsion System (MAPS) contract to Northrop Grumman Systems Corporation of Elkton, Maryland, to provide propulsion support and products for spaceflight missions at the agency’s Marshall Space Flight Center in Huntsville, Alabama.', 2);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(303, 0, , 'NASA to Provide Update on Perseverance ‘Firsts’ Since Mars Landing', 2, 'Since NASA’s Mars 2020 Perseverance rover touched down at Jezero Crater Feb. 18, mission controllers have made substantial progress as they prepare the rover for the unpaved road ahead.', 2);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(304, 0, , 'Vice President Kamala Harris Calls NASA Astronaut Victor Glover', 2, 'In celebration of Black History Month, NASA astronaut Victor Glover welcomed Vice President Kamala Harris to the International Space Station for a virtual chat.', 1);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(305, 0, , 'NASA Celebrates ‘Hidden Figure’ Mary W. Jackson With Building Naming Ceremony', 2, 'On Friday, NASA celebrated the agency’s first African American female engineer, Mary W. Jackson, with a ceremony to formally name the agency’s headquarters building in Washington in her honor.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(306, 0, , 'NASA Awards Launch Service Contract for TROPICS Mission to Study Storm Processes', 2, 'NASA has selected Astra Space Inc. to provide a launch service for the agency’s Time-Resolved Observations of Precipitation Structure and Storm Intensity with a Constellation of SmallSats (TROPICS) mission.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(307, 0, , 'NASA to Honor ‘Hidden Figure’ Mary W. Jackson During Headquarters Naming Ceremony', 2, 'Acting NASA Administrator Steve Jurczyk will lead a ceremony at 1 p.m. EST Friday, Feb. 26, officially naming the NASA Headquarters building in Washington in honor of Mary W. Jackson', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(308, 0, , 'NASA’s Perseverance Rover Gives High-Definition Panoramic View of Landing Site', 2, 'NASA’s Mars 2020 Perseverance rover got its first high-definition look around its new home in Jezero Crater on Feb. 21, after rotating its mast, or “head,” 360 degrees, allowing the rover’s Mastcam-Z instrument to capture its first panorama after touching down on the Red Planet on Feb 18.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(309, 0, , 'NASA Takes Steps to Reduce Aviation Emissions, Invigorate US Economy', 2, 'NASA is seeking proposals for ground and flight demonstrations of integrated megawatt-class powertrain systems for subsonic aircraft.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(310, 0, , 'NASA Awards Contract for Engineering, Programmatic Support Services', 2, 'NASA has awarded the Spectrum and Resource Management, Engineering and Programmatic Support Services (SpectRE) contract to Agile Decision Sciences LLC of Beltsville, Maryland.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(311, 0, , 'NASA to Host Briefings, Interviews for Next Crew Rotation Mission with SpaceX', 2, 'NASA will highlight the second crew rotation flight of a U.S. commercial spacecraft with astronauts to the International Space Station with a pair of news conferences beginning 12:30 p.m. EST Monday, March 1.', 0);
INSERT INTO `images` (`id`, `user_id`, `img`, `title`, `params`, `description`, `likes`) VALUES
(312, 0, , 'NASA’s Perseverance Drives on Mars’ Terrain for First Time', 2, 'NASA’s Mars 2020 Perseverance rover performed its first drive on Mars March 4, covering 21.3 feet (6.5 meters) across the Martian landscape.', 0);
